#! /bin/sh

# whatbasic.sh:  Basic tests for the "what" command.

# Import common functions & definitions.
. ../common/test-common

files="f"

remove $files

trigger="@(#)"

remove f
echo  > f


handle_ekko_failure() {
    miscarry "the ekko command has failed, and while this is a problem with the test suite rather than with CSSC itself, it means that the test suite cannot be successfully completed"
}


# "what" ignores stdin.
docommand w1 "${vg_what} < f" 1 IGNORE IGNORE
docommand w2 "${vg_what} < f" 1 "" ""

# Check basic operation when no match.
docommand w3 "${vg_what}   f" 1 "f:\n" ""


echo "${trigger}foo" > f
echo "invisible" >> f

docommand w4 "${vg_what} f" 0 "f:\n\tfoo\n" ""

# Now we add a space
echo "${trigger}foo" > f
echo "invisible" >> f

# The space should be skipped.
docommand w5 "${vg_what} f" 0 "f:\n\tfoo\n" ""

# Also need to be able to cope with multiple matches in the same file.
echo "${trigger}bar" >> f
echo "invisible2" >> f

docommand w6 "${vg_what} f" 0 "f:\n\tfoo\n\tbar\n" ""


# The -s option should restrict us to just one match. 
docommand w7 "${vg_what} -s f" 0 "f:\n\tfoo\n" ""

# We should be able to diagnose the inability to open the input file.
# We ignore STDERR because we don't want to ensure that the text of the 
# error message is always the same.
docommand w8 "${vg_what} -s nonexistent" 1 "" IGNORE

remove f
echo "${trigger}"foo"${trigger}" > f
echo "invisible" >> f

docommand w9 "${vg_what} f" 0 "f:\n\tfoo${trigger}\n" ""

remove f
echo "@hello@" > f
docommand w10 "${vg_what} f" 1 "f:\n" ""

# Various forms of incomplete trigger
../../testutils/ekko -n "@" > f || handle_ekko_failure
docommand w11 "${vg_what} f" 1 "f:\n" ""

../../testutils/ekko -n "@(" > f || handle_ekko_failure
docommand w12 "${vg_what} f" 1 "f:\n" ""

../../testutils/ekko -n "@(#" > f || handle_ekko_failure
docommand w13 "${vg_what} f" 1 "f:\n" ""

# A match but with nothing to show for it...
../../testutils/ekko -n "@(#)" > f || handle_ekko_failure
docommand w14 "${vg_what} f" 0 "f:\n\t\n" ""


# Provoke a usage error - make sure we get a failure return
# Note the different return value.
docommand w15 "${vg_what} -Z" 1 IGNORE IGNORE


# What-string terminated by a backslash...
remove f
../../testutils/ekko -ne "${trigger}hello\\" > f || handle_ekko_failure
docommand w16 "${vg_what} f" 0 "f:\n\thello\n" ""

# What-string terminated by a null character
remove f
../../testutils/ekko -ne "${trigger}hello\0\nworld" > f || handle_ekko_failure
docommand w17 "${vg_what} f" 0 "f:\n\thello\n" ""

# What-string terminated by a null character
remove f
../../testutils/ekko -ne "${trigger}hello\0world\n" > f || handle_ekko_failure
docommand w18 "${vg_what} f" 0 "f:\n\thello\n" ""

# Various bits of trailing stuff
# Hmm.  What is supposed to ignore various kinds of trailing garbage
# but test that prpoerly we have to insert more than 16K of trailing garbage.
# Let's hope we don;t fall over some kind of limit...
remove f
../../testutils/ekko -ne "${trigger}hello>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>